import React , {useState , useEffect} from 'react';
import { useParams } from 'react-router';

const Scandata=props=>{

    const params=useParams()
    const barcode=params.productbarcode
    const [macros, setmacros] = useState(null);

    useEffect(() => {
        fetch(
            `https://world.openfoodfacts.org/api/v0/product/8901499008299.json`
        )
          .then((response) => response.json())
          .then((data) => {
            setmacros(data.product.nutriments)
          
          })
          .catch(() => {
            console.log("error");
          })},[])
   
   
  
    return (
        <>
        <h1>Carbs {macros.carbohydrates}</h1>
        <h1>Proteins {macros.proteins}</h1>
        <h1>Fats {macros.fat}</h1>
     
        </>

    )

}
export default Scandata;
